/*
* @return 返回一个组件数组, 数组中每个元素为每个问题对应的预览组件
* @accept `ques`: 一个问题描述数组, 数组中每个元素应当包含该问题的 title, type, 以及 options 等必要属性;
* @accept `preview`: bool, 指示是否为预览组件, 为 false 时返回供受邀用户使用的对应问题组件
* */
export function renderPreview(ques, preview) {
	const elements = [];
	ques.forEach(que => {
		switch (que.type){
			case 'text':{
				elements.push((
					<fieldset disabled={preview}>
						<legend>{que.title}</legend>
						<input type="text"/>
					</fieldset>
				))
			}
		}
	})
}
